import styles from './Home.module.scss';

function Home() {
	return (
		<main className={styles.wrapper}>
			<div className={styles.banner}>
				<h2>A joke a day keeps </h2>
			</div>
			<div className={styles.jokeContent}></div>
		</main>
	);
}

export default Home;
